body {
  line-height: 1;
  width: 100%;
  height: 100%;
}

ol,
ul {
  list-style: none;
}

img {
  vertical-align: middle;
  max-width: 100%;
  height: auto;
}

blockquote,
q {
  quotes: none;
}

blockquote:before,
blockquote:after,
q:before,
q:after {
  content: "";
  content: none;
}

table {
  border-collapse: collapse;
  border-spacing: 0;
}

.Container {
  max-width: 1440px;
  margin: 0 auto;
}

body {
  font-family: "Roboto";
}

.Header {
  width: 100%;
  height: 50px;
  position: absolute;
}
.Header #Nav {
  display: flex;
  justify-content: flex-end;
}
.Header #Btn-mobile {
  margin: 7px;
}
.Header-menu a {
  color: #fff;
  text-decoration: none;
}
@media (max-width: 2000px) {
  .Header-menu {
    position: absolute;
    width: 100%;
    background: #0D162F;
    text-align: center;
    height: 0px;
    transition: 0.6s;
    z-index: 1000;
    visibility: hidden;
    overflow-y: hidden;
  }
  .Header-menu li {
    margin-top: 100px;
  }
  .Header-menu a {
    font-size: 30px;
    border-bottom: 2px solid #fff;
  }
  #Nav.active .Header-menu {
    height: 100vh;
    visibility: visible;
  }
  .Header #Btn-mobile {
    display: flex;
    padding: 8px 13px;
    font-size: 18px;
    border: none;
    background: none;
    cursor: pointer;
    gap: 5px;
    z-index: 1001;
  }
  .Header #Hamburguer {
    display: block;
    color: #fff;
    width: 20px;
    border-top: 2px solid;
  }
  .Header #Hamburguer::after, .Header #Hamburguer::before {
    content: "";
    display: block;
    width: 20px;
    height: 2px;
    background: blue;
    margin-top: 5px;
    background: currentColor;
    transition: 0.3s;
    position: relative;
  }
  .Header #Nav.active #Hamburguer {
    border-top-color: transparent;
  }
  .Header #Nav.active #Hamburguer::before {
    transform: rotate(135deg);
  }
  .Header #Nav.active #Hamburguer::after {
    transform: rotate(-135deg);
    top: -7px;
  }
}

